        public static MemoryStream UpdateDataIntoExcelTemplate(List<ThongTinVanBan> listData, FileInfo path)
        {
            MemoryStream stream = new MemoryStream();
            if (path.Exists)
            {
                ExcelPackage.LicenseContext = LicenseContext.NonCommercial;
                using (ExcelPackage p = new ExcelPackage(path))
                {
                    ExcelWorksheet wsEstimate = p.Workbook.Worksheets[0];
                    int rowStart = 6;
                    int stt = 1;
                    foreach (var item in listData)
                    {
                        wsEstimate.Cells[rowStart, 1].Value = stt;
                        wsEstimate.Cells[rowStart, 2].Value = item.SoKyHieu;
                        wsEstimate.Cells[rowStart, 3].Value = item.NgayBanHanh?.ToString("dd/MM/yyyy");
                        wsEstimate.Cells[rowStart, 4].Value = item.CoQuanBanHanh;
                        wsEstimate.Cells[rowStart, 5].Value = item.TrichYeu;
                        rowStart++;
                        stt++;
                    }
                    //wsEstimate.Cells["A6"].LoadFromCollection(listData);
                    p.SaveAs(stream);
                    stream.Position = 0;
                }
            }
            return stream;
        }
        public static void convertPDFToDoc(string filePath) {
            java.io.File file = new java.io.File(filePath);

            PDDocument doc = PDDocument.load(file);
            PDFTextStripper textStrip = new PDFTextStripper();
            string strPDFText = textStrip.getText(doc);
            doc.close();

            string fn = filePath + @"\Test.docx";
            var wordDoc = DocX.Create(fn);
            wordDoc.InsertParagraph(strPDFText);
            wordDoc.Save();

        }
        public static void decodeFileToBase64 (string b64Str, string pathFile){
            //GetTextFromPDF(pathFile);
            ExtractAsJson(pathFile);
            b64Str = "";
            Byte[] bytes = Convert.FromBase64String(b64Str);
            System.IO.File.WriteAllBytes(pathFile +@"\Test.pdf", bytes);
            convertPDFToDoc(pathFile + @"\Test.pdf");
        }

